import { Box, Grid, Typography } from "@mui/material";
import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getCartList } from "../../Action/ProductAction";
import Singlecart from "./Singlecart";
const Cart = () => {
  const dispatch = useDispatch();
  const CartList = useSelector((state) => state.ProductReducer.CartData.data);
  console.log(CartList, "Cartlist");
  useEffect(() => {
    dispatch(getCartList());
  }, [dispatch]);
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "center",
        flexDirection: "column",
      }}
    >
      <Box sx={{ minWidth: "70vw", mt: 2 }}>
        <Typography sx={{ textAlign: "center" }}>My Cart List's</Typography>
        <Box sx={{ width: "100%", backgroundColor: "whitesmoke", mt: 1 }}>
          <Singlecart />
        </Box>
      </Box>
    </Box>
  );
};
export default Cart;
